import React, { Component } from "react";
import {
  TextField,
  Container,
  Button,
  Tabs,
  Tab,
  Typography
} from "@material-ui/core";

export default class Lgon extends Component {
  state = {
    value: "one"
  };

  TabPanel(props) {
    const { children, value, index, ...other } = props;

    return (
      <Typography
        component="div"
        role="tabpanel"
        hidden={value !== index}
        id={`wrapped-tabpanel-${index}`}
        aria-labelledby={`wrapped-tab-${index}`}
        {...other}
      >
        <Box p={3}>{children}</Box>
      </Typography>
    );
  }
  render() {
    return (
      <div style={{}}>
        <Tabs
          style={{ color: "blue", marginTop: 20 }}
          value={this.state.value}
          onChange={(event, newValue) => {
            this.setState({ value: newValue });
            console.log(newValue);
          }}
        >
          <Tab value="zero" label="LOGIN">
            Hello
          </Tab>
          <Tab value="one" label="REGISTER">
            Kaka
          </Tab>
        </Tabs>
      </div>
    );
  }
}

